0436\u0435\u043d\u0438\u044f \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_III_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 III (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u043f\u0430\u043f\u0435 \u041d\u0438\u043a\u043e\u043b\u0430\u044e III<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1563\" class=\"mw-redirect\" title=\"1563\">1563<\/a>&#160;\u2014 \u0420\u0443\u0441\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041b\u0438\u0432\u043e\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041b\u0438\u0432\u043e\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%B0%D0%B4%D0%B0_%D0%9F%D0%BE%D0%BB%D0%BE%D1%86%D0%BA%D0%B0_(1563)\" title=\"\u041e\u0441\u0430\u0434\u0430 \u041f\u043e\u043b\u043e\u0446\u043a\u0430 (1563)\">\u0432\u0437\u044f\u043b\u0438<\/a>  <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%BE%D1%86%D0%BA\" title=\"\u041f\u043e\u043b\u043e\u0446\u043a\">\u041f\u043e\u043b\u043e\u0446\u043a<\/a>. \u0412\u0441\u043a\u043e\u0440\u0435 \u043f\u043e\u0441\u043b\u0435 \u0432\u0437\u044f\u0442\u0438\u044f \u0433\u043e\u0440\u043e\u0434\u0430 \u043f\u043e\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u0438 \u043a\u0430\u0437\u043d\u0438\u043b\u0438 \u043f\u0440\u043e\u0436\u0438\u0432\u0430\u0432\u0448\u0438\u0445 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u0435\u0432\u0440\u0435\u0435\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1565\" class=\"mw-redirect\" title=\"1565\">1565<\/a>&#160;\u2014 \u0412\u043e\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0446\u0430\u0440\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B2%D0%B0%D0%BD_%D0%93%D1%80%D0%BE%D0%B7%D0%BD%D1%8B%D0%B9\" title=\"\u0418\u0432\u0430\u043d \u0413\u0440\u043e\u0437\u043d\u044b\u0439\">\u0418\u0432\u0430\u043d\u0430 IV \u0413\u0440\u043e\u0437\u043d\u043e\u0433\u043e<\/a> \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%BB%D0%BE%D0%B1%D0%BE%D0%B4%D0%B0\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0441\u043a\u0430\u044f \u0441\u043b\u043e\u0431\u043e\u0434\u0430\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0441\u043a\u043e\u0439 \u0441\u043b\u043e\u0431\u043e\u0434\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0443<\/a> \u0438 \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u0438\u0435 \u043e \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D1%80%D0%B8%D1%87%D0%BD%D0%B8%D0%BD%D0%B0\" title=\"\u041e\u043f\u0440\u0438\u0447\u043d\u0438\u043d\u0430\">\u043e\u043f\u0440\u0438\u0447\u043d\u0438\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1717\" class=\"mw-redirect\" title=\"1717\">1717<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043d\u0430\u043f\u0435\u0447\u0430\u0442\u0430\u043d\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D1%87%D0%B5%D1%81%D1%82%D0%BD%D0%BE%D0%B5_%D0%B7%D0%B5%D1%80%D1%86%D0%B0%D0%BB%D0%BE\" title=\"\u042e\u043d\u043e\u0441\u0442\u0438 \u0447\u0435\u0441\u0442\u043d\u043e\u0435 \u0437\u0435\u0440\u0446\u0430\u043b\u043e\">\u042e\u043d\u043e\u0441\u0442\u0438 \u0447\u0435\u0441\u0442\u043d\u043e\u0435 \u0437\u0435\u0440\u0446\u0430\u043b\u043e, \u0438\u043b\u0438 \u041f\u043e\u043a\u0430\u0437\u0430\u043d\u0438\u0435 \u043a \u0436\u0438\u0442\u0435\u0439\u0441\u043a\u043e\u043c\u0443 \u043e\u0431\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u044e<\/a>\u00bb&#160;\u2014 \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0434\u0435\u0442\u0441\u043a\u0430\u044f \u00ab\u0432\u043e\u0441\u043f\u0438\u0442\u0443\u044e\u0449\u0430\u044f\u00bb \u043a\u043d\u0438\u0433\u0430, \u0441\u0442\u0430\u0432\u0448\u0430\u044f \u043e\u0442\u0440\u0430\u0436\u0435\u043d\u0438\u0435\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u0430<\/a> \u0432 \u0434\u0435\u043b\u0435 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u044e\u043d\u043e\u0433\u043e \u043f\u043e\u043a\u043e\u043b\u0435\u043d\u0438\u044f \u0434\u0432\u043e\u0440\u044f\u043d\u0441\u0442\u0432\u0430. \u041f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u043c\u044b\u0439 \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044c&#160;\u2014 \u0435\u043f\u0438\u0441\u043a\u043e\u043f \u0420\u044f\u0437\u0430\u043d\u0441\u043a\u0438\u0439 \u0438 \u041c\u0443\u0440\u043e\u043c\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B2%D1%80%D0%B8%D0%B8%D0%BB_(%D0%91%D1%83%D0%B6%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9)\" title=\"\u0413\u0430\u0432\u0440\u0438\u0438\u043b (\u0411\u0443\u0436\u0438\u043d\u0441\u043a\u0438\u0439)\">\u0413\u0430\u0432\u0440\u0438\u0438\u043b (\u0411\u0443\u0436\u0438\u043d\u0441\u043a\u0438\u0439)<\/a>. \u0412 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u043a\u043d\u0438\u0433\u0438 \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u043b \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0435 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 \u0438 \u043a\u0443\u0440\u0438\u0440\u043e\u0432\u0430\u043b \u0435\u0451 \u0438\u0437\u0434\u0430\u043d\u0438\u0435 \u0441\u043f\u043e\u0434\u0432\u0438\u0436\u043d\u0438\u043a \u041f\u0435\u0442\u0440\u0430, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BA%D0%BE%D0%B2_%D0%91%D1%80%D1%8E%D1%81\" class=\"mw-redirect\" title=\"\u042f\u043a\u043e\u0432 \u0411\u0440\u044e\u0441\">\u042f\u043a\u043e\u0432 \u0411\u0440\u044e\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1763_%D0%B3%D0%BE%D0%B4\" title=\"1763 \u0433\u043e\u0434\">1763<\/a>&#160;\u2014 \u0412 \u0441\u0430\u043a\u0441\u043e\u043d\u0441\u043a\u043e\u043c \u043e\u0445\u043e\u0442\u043d\u0438\u0447\u044c\u0435\u043c \u0437\u0430\u043c\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B1%D0%B5%D1%80%D1%82%D1%83%D1%81%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0413\u0443\u0431\u0435\u0440\u0442\u0443\u0441\u0431\u0443\u0440\u0433\">\u0413\u0443\u0431\u0435\u0440\u0442\u0443\u0441\u0431\u0443\u0440\u0433<\/a>, \u043d\u0435\u0434\u0430\u043b\u0435\u043a\u043e \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B9%D0%BF%D1%86%D0%B8%D0%B3\" title=\"\u041b\u0435\u0439\u043f\u0446\u0438\u0433\">\u041b\u0435\u0439\u043f\u0446\u0438\u0433\u0430<\/a>, \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B1%D0%B5%D1%80%D1%82%D1%83%D1%81%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80\" title=\"\u0413\u0443\u0431\u0435\u0440\u0442\u0443\u0441\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\">\u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f (\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e)\">\u041f\u0440\u0443\u0441\u0441\u0438\u0435\u0439<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0435\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BA%D1%81%D0%BE%D0%BD%D0%B8%D1%8F_(%D0%BA%D1%83%D1%80%D1%84%D1%8E%D1%80%D1%88%D0%B5%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u0421\u0430\u043a\u0441\u043e\u043d\u0438\u044f (\u043a\u0443\u0440\u0444\u044e\u0440\u0448\u0435\u0441\u0442\u0432\u043e)\">\u0421\u0430\u043a\u0441\u043e\u043d\u0438\u0435\u0439<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BC%D0%B8%D0%BB%D0%B5%D1%82%D0%BD%D1%8F%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0421\u0435\u043c\u0438\u043b\u0435\u0442\u043d\u044f\u044f \u0432\u043e\u0439\u043d\u0430\">\u0421\u0435\u043c\u0438\u043b\u0435\u0442\u043d\u044e\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1775\" class=\"mw-redirect\" title=\"1775\">1775<\/a>&#160;\u2014 250-\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439\">\u043f\u0430\u043f\u043e\u0439 \u0440\u0438\u043c\u0441\u043a\u0438\u043c<\/a> \u0438\u0437\u0431\u0440\u0430\u043d \u0414\u0436\u0430\u043d\u0430\u043d\u0434\u0436\u0435\u043b\u043e \u0433\u0440\u0430\u0444 \u0411\u0440\u0430\u0441\u043a\u0438, \u043f\u0440\u0438\u043d\u044f\u0432\u0448\u0438\u0439 \u0438\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%B9_VI\" title=\"\u041f\u0438\u0439 VI\">\u041f\u0438\u0439 VI<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1786\" class=\"mw-redirect\" title=\"1786\">1786<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D1%88%D0%B5%D0%BB%D1%8C,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" title=\"\u0413\u0435\u0440\u0448\u0435\u043b\u044c, \u0423\u0438\u043b\u044c\u044f\u043c\">\u0423\u0438\u043b\u044c\u044f\u043c\u043e\u043c \u0413\u0435\u0440\u0448\u0435\u043b\u0435\u043c<\/a> \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0%D1%80%D0%BD%D0%B0%D1%8F_%D1%82%D1%83%D0%BC%D0%B0%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u041f\u043b\u0430\u043d\u0435\u0442\u0430\u0440\u043d\u0430\u044f \u0442\u0443\u043c\u0430\u043d\u043d\u043e\u0441\u0442\u044c\">\u043f\u043b\u0430\u043d\u0435\u0442\u0430\u0440\u043d\u0430\u044f \u0442\u0443\u043c\u0430\u043d\u043d\u043e\u0441\u0442\u044c<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B7%D0%B2%D0%B5%D0%B7%D0%B4%D0%B8%D0%B5\" title=\"\u0421\u043e\u0437\u0432\u0435\u0437\u0434\u0438\u0435\">\u0441\u043e\u0437\u0432\u0435\u0437\u0434\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%80%D0%B0%D0%BA%D0%BE%D0%BD_(%D1%81%D0%BE%D0%B7%D0%B2%D0%B5%D0%B7%D0%B4%D0%B8%D0%B5)\" title=\"\u0414\u0440\u0430\u043a\u043e\u043d (\u0441\u043e\u0437\u0432\u0435\u0437\u0434\u0438\u0435)\">\u0414\u0440\u0430\u043a\u043e\u043d\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%BC%D0%B0%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D0%9A%D0%BE%D1%88%D0%B0%D1%87%D0%B8%D0%B9_%D0%93%D0%BB%D0%B0%D0%B7\" title=\"\u0422\u0443\u043c\u0430\u043d\u043d\u043e\u0441\u0442\u044c \u041a\u043e\u0448\u0430\u0447\u0438\u0439 \u0413\u043b\u0430\u0437\">\u041a\u043e\u0448\u0430\u0447\u0438\u0439 \u0413\u043b\u0430\u0437<\/a>\u00bb. \u041e\u043d\u0430 \u0441\u0442\u0430\u043b\u0430 \u043f\u0435\u0440\u0432\u043e\u0439 \u043f\u043b\u0430\u043d\u0435\u0442\u0430\u0440\u043d\u043e\u0439 \u0442\u0443\u043c\u0430\u043d\u043d\u043e\u0441\u0442\u044c\u044e, \u0443 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0431\u044b\u043b \u0438\u0437\u0443\u0447\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B5%D0%BA%D1%82%D1%80\" title=\"\u0421\u043f\u0435\u043a\u0442\u0440\">\u0441\u043f\u0435\u043a\u0442\u0440<\/a>. \u042d\u0442\u043e \u0441\u0434\u0435\u043b\u0430\u043b \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D1%82%D1%80%D0%BE%D0%BD%D0%BE%D0%BC-%D0%BB%D1%8E%D0%B1%D0%B8%D1%82%D0%B5%D0%BB%D1%8C\" class=\"mw-redirect\" title=\"\u0410\u0441\u0442\u0440\u043e\u043d\u043e\u043c-\u043b\u044e\u0431\u0438\u0442\u0435\u043b\u044c\">\u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c-\u043b\u044e\u0431\u0438\u0442\u0435\u043b\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%B3%D0%B3%D0%B8%D0%BD%D1%81,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" title=\"\u0425\u0430\u0433\u0433\u0438\u043d\u0441, \u0423\u0438\u043b\u044c\u044f\u043c\">\u0423\u0438\u043b\u044c\u044f\u043c \u0425\u0430\u0433\u0433\u0438\u043d\u0441<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1864_%D0%B3%D0%BE%D0%B4\" title=\"1864 \u0433\u043e\u0434\">1864 \u0433\u043e\u0434\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794\" class=\"mw-redirect\" title=\"1794\">1794<\/a>&#160;\u2014 \u0411\u044b\u043b \u043f\u0440\u0438\u043d\u044f\u0442 \u0432\u043e\u0435\u043d\u043d\u043e-\u043c\u043e\u0440\u0441\u043a\u043e\u0439 \u0442\u0440\u0451\u0445\u0446\u0432\u0435\u0442\u043d\u044b\u0439 \u0444\u043b\u0430\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a>, \u0438\u043c\u0435\u043d\u043d\u043e \u043a \u043d\u0435\u043c\u0443 \u043e\u0442\u043d\u043e\u0441\u0438\u0442\u0441\u044f \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0436\u0435\u043d\u0438\u0435 \u00ab\u0441\u0438\u043d\u0438\u0439 \u0443 \u0434\u0440\u0435\u0432\u043a\u0430, \u0431\u0435\u043b\u044b\u0439 \u0432 \u0446\u0435\u043d\u0442\u0440\u0435 \u0438 \u043a\u0440\u0430\u0441\u043d\u044b\u0439 \u0432 \u043a\u043e\u043d\u0446\u0435\u00bb, \u043f\u0440\u0438\u043d\u044f\u0442\u043e\u0435 \u043f\u043e \u043d\u0430\u0441\u0442\u043e\u044f\u043d\u0438\u044e \u0447\u043b\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%BE%D0%B1%D1%89%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE_%D1%81%D0%BF%D0%B0%D1%81%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u043e\u043c\u0438\u0442\u0435\u0442 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u043f\u0430\u0441\u0435\u043d\u0438\u044f\">\u041a\u043e\u043c\u0438\u0442\u0435\u0442\u0430 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u043f\u0430\u0441\u0435\u043d\u0438\u044f<\/a> \u0416\u0430\u043d \u0411\u043e\u043d\u0430 \u0421\u0435\u043d\u0442-\u0410\u043d\u0434\u0440\u0435, \u043a\u0443\u0440\u0438\u0440\u043e\u0432\u0430\u0432\u0448\u0435\u0433\u043e \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u0444\u043b\u043e\u0442. \u0420\u0438\u0441\u0443\u043d\u043a\u0438 \u0444\u043b\u0430\u0433\u043e\u0432 \u0438 \u0432\u044b\u043c\u043f\u0435\u043b\u043e\u0432 \u0434\u0435\u043b\u0430\u043b \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%B2%D0%B8%D0%B4,_%D0%96%D0%B0%D0%BA_%D0%9B%D1%83%D0%B8\" class=\"mw-redirect\" title=\"\u0414\u0430\u0432\u0438\u0434, \u0416\u0430\u043a \u041b\u0443\u0438\">\u0416\u0430\u043a \u041b\u0443\u0438 \u0414\u0430\u0432\u0438\u0434<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/17_%D1%84%D0%B5%D0%B2%D1%80%D0%B0%D0%BB%D1%8F\" title=\"17 \u0444\u0435\u0432\u0440\u0430\u043b\u044f\">17 \u0444\u0435\u0432\u0440\u0430\u043b\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794_%D0%B3%D0%BE%D0%B4\" title=\"1794 \u0433\u043e\u0434\">1794 \u0433\u043e\u0434\u0430<\/a> \u044d\u0442\u043e\u0442 \u0444\u043b\u0430\u0433 \u043f\u043e\u0434\u043d\u044f\u043b\u0438 \u0432\u043e\u0435\u043d\u043d\u044b\u0435 \u043a\u043e\u0440\u0430\u0431\u043b\u0438 \u041e\u043a\u0435\u0430\u043d\u0441\u043a\u043e\u0439 \u044d\u0441\u043a\u0430\u0434\u0440\u044b. \u0421 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/20_%D0%BC%D0%B0%D1%8F\" title=\"20 \u043c\u0430\u044f\">20 \u043c\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1794_%D0%B3%D0%BE%D0%B4\" title=\"1794 \u0433\u043e\u0434\">1794&#160;\u0433\u043e\u0434\u0430<\/a> \u044d\u0442\u043e\u0442 \u0444\u043b\u0430\u0433 \u0431\u044b\u043b \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8\" title=\"\u0424\u043b\u0430\u0433 \u0424\u0440\u0430\u043d\u0446\u0438\u0438\">\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u043c \u0444\u043b\u0430\u0433\u043e\u043c \u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1798\" class=\"mw-redirect\" title=\"1798\">1798<\/a>&#160;\u2014 \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0432\u0442\u043e\u0440\u0436\u0435\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC\" title=\"\u0420\u0438\u043c\">\u0420\u0438\u043c<\/a> \u0432\u043e\u0439\u0441\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I\">\u043d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u043e\u0432\u0441\u043a\u043e\u0439<\/a> \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D1%82%D1%8C%D0%B5,_%D0%9B%D1%83%D0%B8_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80\" title=\"\u0411\u0435\u0440\u0442\u044c\u0435, \u041b\u0443\u0438 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\">\u041b\u0443\u0438 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0411\u0435\u0440\u0442\u044c\u0435<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_(1798%E2%80%941799)\" title=\"\u0420\u0438\u043c\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 (1798\u20141799)\">\u0420\u0438\u043c\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a>. \u0420\u0438\u043c\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0431\u044b\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%87%D0%B5%D1%80%D0%BD%D0%B8%D0%B5_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8\" title=\"\u0414\u043e\u0447\u0435\u0440\u043d\u0438\u0435 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438\">\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c-\u0441\u0430\u0442\u0435\u043b\u043b\u0438\u0442\u043e\u043c<\/a> \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u0438 \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u043b\u0430\u0441\u044c \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%BE%D0%BB%D0%BD%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%94%D0%B8%D1%80%D0%B5%D0%BA%D1%82%D0%BE%D1%80%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0418\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u044f\">\u0414\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0438\u0435\u0439<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895_%D0%B3%D0%BE%D0%B4\" title=\"1895 \u0433\u043e\u0434\">1895<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u043e \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u0438\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%91%D1%81%D1%82%D1%80%D1%8B_%D0%93%D0%BD%D0%B5%D1%81%D0%B8%D0%BD%D1%8B\" title=\"\u0421\u0451\u0441\u0442\u0440\u044b \u0413\u043d\u0435\u0441\u0438\u043d\u044b\">\u0441\u0435\u0441\u0442\u0451\u0440 \u0413\u043d\u0435\u0441\u0438\u043d\u044b\u0445<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BC%D1%83%D0%B7%D1%8B%D0%BA%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%83%D1%87%D0%B8%D0%BB%D0%B8%D1%89%D0%B5_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%93%D0%BD%D0%B5%D1%81%D0%B8%D0%BD%D1%8B%D1%85\" class=\"mw-redirect\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435 \u0438\u043c\u0435\u043d\u0438 \u0413\u043d\u0435\u0441\u0438\u043d\u044b\u0445\">\u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u0430\u044f \u0448\u043a\u043e\u043b\u0430<\/a> \u0434\u043b\u044f \u0434\u0435\u0442\u0435\u0439. \u0412 \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u043d\u0430 \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u043e\u043c \u0434\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u043e\u043c \u0434\u043e\u043c\u0438\u043a\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B3%D0%B0%D1%80%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D1%83%D0%BB%D0%BE%D0%BA\" title=\"\u0413\u0430\u0433\u0430\u0440\u0438\u043d\u0441\u043a\u0438\u0439 \u043f\u0435\u0440\u0435\u0443\u043b\u043e\u043a\">\u0413\u0430\u0433\u0430\u0440\u0438\u043d\u0441\u043a\u043e\u043c \u043f\u0435\u0440\u0435\u0443\u043b\u043a\u0435<\/a> \u043f\u043e\u044f\u0432\u0438\u043b\u0430\u0441\u044c \u0432\u044b\u0432\u0435\u0441\u043a\u0430: \u00ab\u041c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435 \u0415. \u0438 \u041c. \u0413\u043d\u0435\u0441\u0438\u043d\u044b\u0445\u00bb \u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u0437\u0430\u0447\u0438\u0441\u043b\u0435\u043d\u0438\u0435 \u043f\u0435\u0440\u0432\u043e\u0439 \u0443\u0447\u0435\u043d\u0438\u0446\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1897_%D0%B3%D0%BE%D0%B4\" title=\"1897 \u0433\u043e\u0434\">1897<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%83%D0%BD,_%D0%9A%D0%B0%D1%80%D0%BB_%D0%A4%D0%B5%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D0%BD%D0%B4\" title=\"\u0411\u0440\u0430\u0443\u043d, \u041a\u0430\u0440\u043b \u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434\">\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434 \u0411\u0440\u0430\u0443\u043d<\/a> \u043f\u0443\u0431\u043b\u0438\u043a\u0443\u0435\u0442 \u0441\u0445\u0435\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%86%D0%B8%D0%BB%D0%BB%D0%BE%D0%B3%D1%80%D0%B0%D1%84\" title=\"\u041e\u0441\u0446\u0438\u043b\u043b\u043e\u0433\u0440\u0430\u0444\">\u043e\u0441\u0446\u0438\u043b\u043b\u043e\u0433\u0440\u0430\u0444\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898\" class=\"mw-redirect\" title=\"1898\">1898<\/a>&#160;\u2014 \u0413\u0438\u0431\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%A1%D0%A8%D0%90\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u0441\u0438\u043b\u044b \u0421\u0428\u0410\">\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%BE%D0%BD%D0%B5%D0%BD%D0%BE%D1%81%D0%B5%D1%86\" title=\"\u0411\u0440\u043e\u043d\u0435\u043d\u043e\u0441\u0435\u0446\">\u0431\u0440\u043e\u043d\u0435\u043d\u043e\u0441\u0446\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/USS_Maine_(ACR-1)\" title=\"USS Maine (ACR-1)\">\u041c\u044d\u043d<\/a>\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B2%D0%B0%D0%BD%D0%B0\" title=\"\u0413\u0430\u0432\u0430\u043d\u0430\">\u0413\u0430\u0432\u0430\u043d\u0435<\/a>. \u0412 \u043a\u043e\u043d\u0446\u0435 \u044f\u043d\u0432\u0430\u0440\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898 \u0433\u043e\u0434\u0430<\/a> \u043e\u043d \u043f\u0440\u0438\u0431\u044b\u043b \u0432 \u0413\u0430\u0432\u0430\u043d\u0443 \u0441 \u0432\u0438\u0437\u0438\u0442\u043e\u043c \u0434\u043e\u0431\u0440\u043e\u0439 \u0432\u043e\u043b\u0438 \u0434\u043b\u044f \u0437\u0430\u0449\u0438\u0442\u044b \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043e\u0432 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0\" title=\"\u041a\u0443\u0431\u0430\">\u041a\u0443\u0431\u0435<\/a>, \u0433\u0434\u0435 \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C_%D0%9A%D1%83%D0%B1%D1%8B\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u041a\u0443\u0431\u044b\">\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u043e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u043f\u0440\u043e\u0442\u0438\u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>. \u0423\u0442\u0440\u043e\u043c 15 \u0444\u0435\u0432\u0440\u0430\u043b\u044f \u0441\u0442\u043e\u044f\u0432\u0448\u0438\u0439 \u0432 \u0433\u0430\u0432\u0430\u043d\u0438 \u043a\u043e\u0440\u0430\u0431\u043b\u044c \u0441\u043e\u0442\u0440\u044f\u0441\u043b\u0438 \u0434\u0432\u0430 \u043c\u043e\u0449\u043d\u044b\u0445 \u0432\u0437\u0440\u044b\u0432\u0430, \u0438 \u0432 9 \u0447\u0430\u0441\u043e\u0432 40 \u043c\u0438\u043d\u0443\u0442 \u043e\u043d \u0437\u0430\u0442\u043e\u043d\u0443\u043b, \u0443\u043d\u0435\u0441\u044f \u0441 \u0441\u043e\u0431\u043e\u0439 \u0436\u0438\u0437\u043d\u0438 260 \u043c\u043e\u0440\u044f\u043a\u043e\u0432. \u0422\u043e\u0447\u043d\u0430\u044f \u043f\u0440\u0438\u0447\u0438\u043d\u0430 \u0432\u0437\u0440\u044b\u0432\u043e\u0432 \u0442\u0430\u043a \u0438 \u043d\u0435 \u0431\u044b\u043b\u0430 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430, \u043d\u043e \u0438\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0431\u044b\u043b \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d \u0436\u0451\u043b\u0442\u043e\u0439 \u043f\u0440\u0435\u0441\u0441\u043e\u0439 \u0434\u043b\u044f \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044f \u0432 \u0441\u043b\u0443\u0447\u0438\u0432\u0448\u0435\u043c\u0441\u044f \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0445 \u0432\u043b\u0430\u0441\u0442\u0435\u0439. \u0418\u0442\u043e\u0433\u043e\u043c \u043f\u043e\u0434\u043d\u044f\u0432\u0448\u0435\u0439\u0441\u044f \u0432\u043e\u043b\u043d\u044b \u0438\u0441\u0442\u0435\u0440\u0438\u0438 \u0441\u0442\u0430\u043b\u043e \u043e\u0431\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0432 \u0430\u043f\u0440\u0435\u043b\u0435 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA-%D0%9A%D0%B8%D0%BD%D0%BB%D0%B8,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC\" title=\"\u041c\u0430\u043a-\u041a\u0438\u043d\u043b\u0438, \u0423\u0438\u043b\u044c\u044f\u043c\">\u041c\u0430\u043a-\u041a\u0438\u043d\u043b\u0438<\/a> \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410\">\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0443<\/a> \u0441 \u043f\u0440\u0438\u0437\u044b\u0432\u043e\u043c \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0441\u0442\u0438 \u00ab\u043d\u0430\u0441\u0438\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u0443\u043c\u0438\u0440\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0435 \u041a\u0443\u0431\u044b\u00bb. \u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u043f\u0440\u0438\u0437\u043d\u0430\u043b \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u041a\u0443\u0431\u044b, \u043f\u043e\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043b \u0432\u044b\u0432\u0435\u0441\u0442\u0438 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0435<\/a> \u0432\u043e\u0439\u0441\u043a\u0430 \u0438 \u0443\u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0438\u043b \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0435 \u0441\u0438\u043b\u044b. \u0412 \u043e\u0442\u0432\u0435\u0442 \u043d\u0430 \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u0438\u0435 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u0430\u043c\u0438 \u0431\u043b\u043e\u043a\u0430\u0434\u044b \u041a\u0443\u0431\u044b \u0418\u0441\u043f\u0430\u043d\u0438\u044f \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%BE-%D0%B0%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0418\u0441\u043f\u0430\u043d\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0432\u043e\u0439\u043d\u0443<\/a> \u0421\u0428\u0410. \u0415\u0451 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u044b \u0434\u043b\u044f \u0438\u0441\u043f\u0430\u043d\u0446\u0435\u0432 \u043e\u043a\u0430\u0437\u0430\u043b\u0438\u0441\u044c \u043f\u0435\u0447\u0430\u043b\u044c\u043d\u044b\u043c\u0438, \u0430 \u0421\u0428\u0410 \u0432 \u0445\u043e\u0434\u0435 \u0432\u043e\u0439\u043d\u044b \u0430\u043d\u043d\u0435\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%93%D0%B0%D0%B2%D0%B0%D0%B9%D0%B8\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u0413\u0430\u0432\u0430\u0439\u0438\">\u0413\u0430\u0432\u0430\u0439\u0441\u043a\u0443\u044e \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0443<\/a>, \u043e\u043a\u043a\u0443\u043f\u0438\u0440\u043e\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%8D%D1%80%D1%82%D0%BE-%D0%A0%D0%B8%D0%BA%D0%BE\" title=\"\u041f\u0443\u044d\u0440\u0442\u043e-\u0420\u0438\u043a\u043e\">\u041f\u0443\u044d\u0440\u0442\u043e-\u0420\u0438\u043a\u043e<\/a>, \u0432\u044b\u0441\u0430\u0434\u0438\u043b\u0438\u0441\u044c \u043d\u0430 \u041a\u0443\u0431\u0435, \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u043e\u0442 \u0418\u0441\u043f\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%B8%D0%BD%D1%8B\" title=\"\u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d\u044b\">\u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d\u044b<\/a>, \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u044f \u0432 \u0438\u0442\u043e\u0433\u0435 \u0446\u0435\u043b\u0443\u044e \u043a\u043e\u043b\u043e\u043d\u0438\u0430\u043b\u044c\u043d\u0443\u044e \u0438\u043c\u043f\u0435\u0440\u0438\u044e \u0441 \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u0435\u043c 8,5 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0430 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1899_%D0%B3%D0%BE%D0%B4\" title=\"1899 \u0433\u043e\u0434\">1899<\/a>&#160;\u2014 \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0441\u043a\u0438\u0439 \u043c\u0430\u043d\u0438\u0444\u0435\u0441\u0442 \u043e \u043f\u0440\u0435\u043e\u0431\u043b\u0430\u0434\u0430\u043d\u0438\u0438 \u0437\u0430\u043a\u043e\u043d\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438 \u043d\u0430\u0434 \u0444\u0438\u043d\u043b\u044f\u043d\u0434\u0441\u043a\u0438\u043c \u0437\u0430\u043a\u043e\u043d\u043e\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c. \u041d\u0430\u0447\u0430\u043b\u043e \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D0%B8%D1%84%D0%B8%D0%BA%D0%B0%D1%86%D0%B8%D1%8F_%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D0%B8\" title=\"\u0420\u0443\u0441\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438\">\u0440\u0443\u0441\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438 \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438<\/a>, \u043f\u0440\u043e\u0432\u043e\u0434\u043d\u0438\u043a\u043e\u043c \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u0433\u0435\u043d\u0435\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B1%D1%80%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u043e\u0431\u0440\u0438\u043a\u043e\u0432, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u041d. \u0411\u043e\u0431\u0440\u0438\u043a\u043e\u0432<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D0%B8_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD%D0%B0\" title=\"1902 \u0433\u043e\u0434 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430\">1902<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043b\u0438\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0440\u043e<\/a>, \u0441\u043e\u0435\u0434\u0438\u043d\u0438\u0432\u0448\u0430\u044f \u043c\u0435\u0436\u0434\u0443 \u0441\u043e\u0431\u043e\u0439 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Stralauer_Tor_(Berlin_U-Bahn)\" class=\"extiw\" title=\"en:Stralauer Tor (Berlin U-Bahn)\">\u0428\u0442\u0440\u0430\u043b\u0430\u0443\u044d\u0440 \u0422\u043e\u0440<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BC%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u041d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u043d\u0435\u043c.<\/a>&#160;Stralauer Tor) \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%B0%D0%B4_(%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB)\" class=\"mw-redirect\" title=\"\u0417\u043e\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u0430\u0434 (\u0432\u043e\u043a\u0437\u0430\u043b)\">\u0417\u043e\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0441\u0430\u0434<\/a>, \u0441 \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u0438\u043c \u043e\u0442\u0432\u0435\u0442\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%82%D1%81%D0%B4%D0%B0%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C\" title=\"\u041f\u043e\u0442\u0441\u0434\u0430\u043c\u0441\u043a\u0430\u044f \u043f\u043b\u043e\u0449\u0430\u0434\u044c\">\u041f\u043e\u0442\u0441\u0434\u0430\u043c\u0441\u043a\u0443\u044e \u043f\u043b\u043e\u0449\u0430\u0434\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910\" class=\"mw-redirect\" title=\"1910\">1910<\/a>&#160;\u2014 \u0412\u043e \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u043c \u0430\u044d\u0440\u043e\u043a\u043b\u0443\u0431\u0435 \u0430\u0432\u0438\u0430\u0442\u043e\u0440\u043e\u0432 \u0434\u0438\u043f\u043b\u043e\u043c \u043f\u0438\u043b\u043e\u0442\u0430-\u0430\u0432\u0438\u0430\u0442\u043e\u0440\u0430 \u0437\u0430 \u043d\u043e\u043c\u0435\u0440\u043e\u043c 31 \u043f\u043e\u043b\u0443\u0447\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D1%84%D0%B8%D0%BC%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9D%D0%B8%D0%BA%D0%B8%D1%84%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0415\u0444\u0438\u043c\u043e\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u043e\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u043e\u0432\u0438\u0447 \u0415\u0444\u0438\u043c\u043e\u0432<\/a>, \u0441\u0442\u0430\u0432 \u043f\u0435\u0440\u0432\u044b\u043c \u0434\u0438\u043f\u043b\u043e\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u043c \u0430\u0432\u0438\u0430\u0442\u043e\u0440\u043e\u043c \u0420\u043e\u0441\u0441\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918\" class=\"mw-redirect\" title=\"1918\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u044f<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041b\u0438\u0442\u0432\u0430\">\u041b\u0438\u0442\u0432\u0430<\/a> \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u044f\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BB%D0%B5%D0%BD%D0%B4%D0%B0%D1%80%D1%8C\" title=\"\u0413\u0440\u0438\u0433\u043e\u0440\u0438\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u044c\">\u0433\u0440\u0438\u0433\u043e\u0440\u0438\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4_%D0%B2_%D1%82%D0%B5%D0%B0%D1%82%D1%80%D0%B5\" title=\"1919 \u0433\u043e\u0434 \u0432 \u0442\u04