43e \u0438\u0437\u0431\u0440\u0430\u043d\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A1%D0%A8%D0%90\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B7%D0%B2%D0%B5%D0%BB%D1%8C%D1%82,_%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%BB%D0%B8%D0%BD\" title=\"\u0420\u0443\u0437\u0432\u0435\u043b\u044c\u0442, \u0424\u0440\u0430\u043d\u043a\u043b\u0438\u043d\">\u0424\u0440\u0430\u043d\u043a\u043b\u0438\u043d\u0430 \u0420\u0443\u0437\u0432\u0435\u043b\u044c\u0442\u0430<\/a>. \u041f\u044f\u0442\u044c \u0432\u044b\u043f\u0443\u0449\u0435\u043d\u043d\u044b\u0445 \u0438\u043c \u043f\u0443\u043b\u044c \u043c\u0438\u043d\u043e\u0432\u0430\u043b\u0438 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430, \u043d\u043e \u0440\u0430\u043d\u0438\u043b\u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u043b\u044e\u0434\u0435\u0439. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D1%8D%D1%80%D0%BE%D0%B2_%D0%A7%D0%B8%D0%BA%D0%B0%D0%B3%D0%BE\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u043c\u044d\u0440\u043e\u0432 \u0427\u0438\u043a\u0430\u0433\u043e\">\u041c\u044d\u0440 \u0427\u0438\u043a\u0430\u0433\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D0%BC%D0%B0%D0%BA,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD\" title=\"\u0427\u0435\u0440\u043c\u0430\u043a, \u0410\u043d\u0442\u043e\u043d\">\u0410\u043d\u0442\u043e\u043d \u0427\u0435\u0440\u043c\u0430\u043a<\/a> \u0441\u043a\u043e\u043d\u0447\u0430\u043b\u0441\u044f \u0442\u0440\u0435\u043c\u044f \u043d\u0435\u0434\u0435\u043b\u044f\u043c\u0438 \u043f\u043e\u0437\u0436\u0435. \u0412 \u043e\u0434\u0435\u0436\u0434\u0435 \u0443\u0431\u0438\u0439\u0446\u044b \u043d\u0430\u0448\u043b\u0438 \u0433\u0430\u0437\u0435\u0442\u043d\u0443\u044e 