u0440\u0430<\/a>, \u043e\u0442\u0434\u0430\u043b \u043f\u0440\u0438\u043a\u0430\u0437 \u044d\u0432\u0430\u043a\u0443\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043d\u0430\u0445\u043e\u0434\u0438\u0432\u0448\u0438\u0439\u0441\u044f \u043f\u043e\u0434 \u0435\u0433\u043e \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/2-%D0%B9_%D1%82%D0%B0%D0%BD%D0%BA%D0%BE%D0%B2%D1%8B%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81_%D0%A1%D0%A1\" title=\"2-\u0439 \u0442\u0430\u043d\u043a\u043e\u0432\u044b\u0439 \u043a\u043e\u0440\u043f\u0443\u0441 \u0421\u0421\">\u0442\u0430\u043d\u043a\u043e\u0432\u044b\u0439 \u043a\u043e\u0440\u043f\u0443\u0441 \u0421\u0421<\/a> \u0438\u0437-\u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D1%8C%D0%BA%D0%BE%D0%B2\" title=\"\u0425\u0430\u0440\u044c\u043a\u043e\u0432\">\u0425\u0430\u0440\u044c\u043a\u043e\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943\" class=\"mw-redirect\" title=\"1943\">1943<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D0%BE%D0%B4_%D0%9C%D0%BE%D0%BD%D1%82%D0%B5-%D0%9A%D0%B0%D1%81%D1%81%D0%B8%D0%BD%D0%BE\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u043e\u0434 \u041c\u043e\u043d\u0442\u0435-\u041a\u0430\u0441\u0441\u0438\u043d\u043e\">\u0411\u0438\u0442\u0432\u0430 \u043f\u043e\u0434 \u041c\u043e\u043d\u0442\u0435-\u041a\u0430\u0441\u0441\u0438\u043d\u043e<\/a>: 4-\u044f \u0438\u043d\u0434\u0438\u0439\u0441\u043a\u0430\u044f \u0434\u0438\u0432\u0438\u0437\u0438\u044f \u0438 2-\u044f \u043d\u043e\u0432\u043e\u0437\u0435\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0434\u0438\u0432\u0438\u0437\u0438\u044f \u043d\u0430\u0447\u0438\u043d\u0430\u044e\u0442 \u0432\u0442\u043e\u0440\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%82%D0%B5%D0%BA%D0%B0%D1%81%D1%81%D0%B8%D0%BD%D0%BE\" title=\"\u041c\u043e\u043d\u0442\u0435\u043a\u0430\u0441\u0441\u0438\u043d\u043e\">\u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c \u041c\u043e\u043d\u0442\u0435-\u041a\u0430\u0441\u0441\u0438\u043d\u043e<\/a>. \u0411\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u043a\u0430 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044f, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0438 142 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/B-17\" class=\"mw-redirect\" title=\"B-17\">B-17 \u00ab\u041b\u0435\u0442\u0430\u044e\u0449\u0430\u044f \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u044c\u00bb<\/a>, 47 \u043c\u0430\u0448\u0438\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/B-25\" class=\"mw-redirect\" title=\"B-25\">B-25 \u00ab\u041c\u0438\u0442\u0447\u0435\u043b\u043b\u00bb<\/a> \u0438 40 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Martin_B-26_Marauder\" title=\"Martin B-26 Marauder\">B-26 \u00ab\u041c\u0430\u0440\u043e\u0434\u0435\u0440\u00bb<\/a>. \u0412\u0441\u0435\u0433\u043e \u0432 \u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u043d\u0430 \u0430\u0431\u0431\u0430\u0442\u0441\u0442\u0432\u043e \u0431\u044b\u043b\u043e \u0441\u0431\u0440\u043e\u0448\u0435\u043d\u043e 1150 \u0442\u043e\u043d\u043d \u0431\u043e\u043c\u0431, \u0447\u0442\u043e \u043f\u0440\u0435\u0432\u0440\u0430\u0442\u0438\u043b\u043e \u0432\u0441\u044e \u0432\u0435\u0440\u0445\u0443\u0448\u043a\u0443 \u0433\u043e\u0440\u044b \u041c\u043e\u043d\u0442\u0435-\u041a\u0430\u0441\u0441\u0438\u043d\u043e \u0432 \u0434\u044b\u043c\u044f\u0449\u0443\u044e\u0441\u044f \u0433\u0440\u0443\u0434\u0443 \u043e\u0431\u043b\u043e\u043c\u043a\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a><ul><li>\u0414\u0435\u043c\u043e\u0