u0438\u043e \u0421\u0435\u043d\u044c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 \u0420\u0435\u0439\u0441 548 \u0430\u0432\u0438\u0430\u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Sabena\" title=\"Sabena\">Sabena<\/a>\u00bb, \u00ab\u0411\u043e\u0438\u043d\u0433 707\u00bb, \u0432\u044b\u043b\u0435\u0442\u0435\u0432\u0448\u0438\u0439 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B0%D1%8D%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%94%D0%B6%D0%BE%D0%BD%D0%B0_%D0%9A%D0%B5%D0%BD%D0%BD%D0%B5%D0%B4%D0%B8\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0430\u044d\u0440\u043e\u043f\u043e\u0440\u0442 \u0438\u043c\u0435\u043d\u0438 \u0414\u0436\u043e\u043d\u0430 \u041a\u0435\u043d\u043d\u0435\u0434\u0438\">\u0430\u044d\u0440\u043e\u043f\u043e\u0440\u0442\u0430 \u0414\u0436. \u041a\u0435\u043d\u043d\u0435\u0434\u0438<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a>), <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_Boeing_707_%D0%BF%D0%BE%D0%B4_%D0%91%D1%80%D1%8E%D1%81%D1%81%D0%B5%D0%BB%D0%B5%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 Boeing 707 \u043f\u043e\u0434 \u0411\u0440\u044e\u0441\u0441\u0435\u043b\u0435\u043c\">\u0440\u0430\u0437\u0431\u0438\u043b\u0441\u044f \u043f\u0440\u0438 \u043f\u043e\u0441\u0430\u0434\u043a\u0435<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D1%8E%D1%81%D1%81%D0%B5%D0%BB%D1%8C\" title=\"\u0411\u0440\u044e\u0441\u0441\u0435\u043b\u044c\">\u0411\u0440\u044e\u0441\u0441\u0435\